_3779946868250494233_n.mp4?_nc_ht=instagram.fevn6-3.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=aepcKNbyuYEAX9MhmL2\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oe=62775AF3\u0026oh=00_AT9p2hxGNx-OcH9_9ts3ikRGOJJA5e3j0GYu5DxAr0XTbQ\u0026_nc_sid=7bff83","video_view_count":331,"edge_media_to_caption":{"edges":[{"node":{"text":"We\u2019ve done it!! We\u2019re launching a podcast!! \n\nJoanna here- and personally I\u2019m so over the story that our worth is based on our success, achievements and possessions. That work is only about the outcome.\n\nWhat if we flipped the idea we have of work on its head? What if work wasn\u2019t a career, but was how we found and created meaning in the world? What if work wasn\u2019t a means to an end, but a portal to self discovery?\n\nJoin me, Founder of Yellow Co. @joannawaterfall as we dive into stories from women who do work in a different way. Who live in alignment and in turn, make an impact for good in the world. And in turn, learn how to do the same.\n\nWe officially launch next week and I\u2019d be so appreciative if you\u2019d head to wherever you get your podcasts, type in \u201cCreating Meaningful Work\u201d subscribe and leave a review!! Or click the link in our profile :)\n\nFirst official episode launches next week!! \n\nHuge thanks to Yellow Co. Members @hanna.snyder , @thesheasmith and @jackiepoinierviramontez for contributing your stories to this trailer and the rest of the Yellow Co. members who did as well! Love creating meaningful work with you all \u2764\ufe0f #bloomyellow #cmwpodcast"}}]},"edge_media_to_comment":{"count":6},"comments_disabled":false,"taken_at_timestamp":1650646390,"edge_liked_by":{"count":27},"edge_media_preview_like":{"count":27},"location":null,"nft_asset_info":null,"thumbnail_src":"https://instagram.fevn6-2.fna.fbcdn.net/v/t51.2885-15/278982301_5053785064657946_8723386377967369422_n.jpg?stp=c0.280.720.720a_dst-jpg_e15_s640x640\u0026_nc_ht=instagram.fevn6-2.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=
